selector_to_html = {"a[href=\"#descargar-msmg-toolkit\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Descargar MSMG Toolkit<a class=\"headerlink\" href=\"#descargar-msmg-toolkit\" title=\"Link to this heading\">#</a></h3><p>Ahora sigue la herramienta, <em>MSMG Toolkit</em> <a class=\"reference internal\" href=\"#msmg\" id=\"id3\"><span>[msmg]</span></a>. Es una herramienta gratuita\npara la personalizaci\u00f3n del instalador de Windows, lo cual se traduce en la\nopci\u00f3n de reducir el impacto de los componentes preinstalados tanto en espacio\ncomo en rendimiento, pero tambi\u00e9n hacer uno que otro ajuste est\u00e9tico.</p><p>En la p\u00e1gina descargamos la herramienta <code class=\"code docutils literal notranslate\"><span class=\"pre\">MSMG</span> <span class=\"pre\">Toolkit</span> <span class=\"pre\">v10.1</span></code>, y\ndescargamos <em>MSMG Toolkit Packs</em> solo en caso de querer reinstalar algunas\ncomponentes (es raro, pero la estrategia puede ser m\u00e1s r\u00e1pida eliminando\ncolecciones y luego agregar una que otra componente, pero esto no lo\ndiscutir\u00e9).</p>", "a[href=\"#eliminar-componentes\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Eliminar componentes<a class=\"headerlink\" href=\"#eliminar-componentes\" title=\"Link to this heading\">#</a></h3><p>Este es el paso importante del procedimiento y el m\u00e1s demorado. La forma m\u00e1s\nr\u00e1pida de proceder es eliminar por conjuntos de componentes y no a nivel de\ndetalle.</p><p>Para remover estas componentes vamos a <code class=\"code docutils literal notranslate\"><span class=\"pre\">Remove</span></code> y luego <code class=\"code docutils literal notranslate\"><span class=\"pre\">Remove</span>\n<span class=\"pre\">Windows</span> <span class=\"pre\">Components</span></code>. Ahora tenemos un men\u00fa asociado a los distintos conjuntos\nde componentes que podemos remover. Estos pueden ser removidos como conjunto\no removemos componentes individuales (una a una, lo cual lo hace un\nprocedimiento largo, aburridor y de mucha atenci\u00f3n).</p>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/descargar-msmg-toolkit.png\"><img alt=\"Indicaci\u00f3n del archivo a descargar de MSMG en Mega.\" src=\"../../../../_images/descargar-msmg-toolkit.png\" style=\"width: 800px; height: 400px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Indicaci\u00f3n del archivo a descargar de MSMG en Mega.</span><a class=\"headerlink\" href=\"#id6\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#requisitos-para-crear-la-version-minima\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Requisitos para crear la versi\u00f3n m\u00ednima<a class=\"headerlink\" href=\"#requisitos-para-crear-la-version-minima\" title=\"Link to this heading\">#</a></h2><p>Adem\u00e1s de nuestro equipo con Windows para poder ejecutar el software que nos\nasistir\u00e1 en el proceso, necesitamos dicho software y una imagen de Windows para\nmodificar.</p>", "a[href=\"#inicializar-imagen\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Inicializar imagen<a class=\"headerlink\" href=\"#inicializar-imagen\" title=\"Link to this heading\">#</a></h3><p>La imagen de Windows que obtuvimos la ubicamos en la carpeta ISO de la carpeta\ngenerada al descomprimir la descarga de <em>MSMG Toolkit</em>.</p><p>Tambi\u00e9n en la carpeta de <em>MSMG Toolkit</em>, encontraremos un archivo <em>batch</em>\nllamado <code class=\"code docutils literal notranslate\"><span class=\"pre\">start</span></code>. Daremos doble clic y aceptamos la licencia de uso\ningresando <code class=\"code docutils literal notranslate\"><span class=\"pre\">A</span></code> y luego presionamos <code class=\"code docutils literal notranslate\"><span class=\"pre\">\u21a9</span></code>.</p>", "a[href=\"#consideraciones-finales\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Consideraciones finales<a class=\"headerlink\" href=\"#consideraciones-finales\" title=\"Link to this heading\">#</a></h2><p>A diferencia de distintos sitios que \u00abexplican\u00bb el uso de MSMG, en este caso he\ndetallado adecuadamente las opciones, y en especial parte de selecci\u00f3n de la\nimagen de Windows que no suele decirse m\u00e1s que \u00abuna vez seleccionada\u00bb.</p><p>Si como yo, decides remover todas las componentes posibles, vas a requerir\nPowershell para instalar por comandos al menos el navegador y de ah\u00ed instalar\notros programas, o tener los instaladores listos en una USB. Mi sugerencia, es\naprovechar el gestor de paquetes <em>scoop</em> <a class=\"reference internal\" href=\"#scoop\" id=\"id4\"><span>[scoop]</span></a> que puede\ninstalarse con Powershell siguiendo los pasos del sitio web, y agregar el\nrepositorio de <code class=\"code docutils literal notranslate\"><span class=\"pre\">extras</span></code> para instalar paquetes como <em>Firefox</em>,\n<em>Imageglass</em> y <em>LibreOffice</em> (m\u00e1s adelante har\u00e9 una publicaci\u00f3n al respecto).</p>", "a[href=\"#ejecutar-msmg-toolkit\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ejecutar MSMG Toolkit<a class=\"headerlink\" href=\"#ejecutar-msmg-toolkit\" title=\"Link to this heading\">#</a></h2><p>El foco de esta publucaci\u00f3n se encuentra en eliminar componentes, pues es justo\nlo que impacta espacio de almacenamiento y rendimiento. La opci\u00f3n de\nintegraci\u00f3n depende de los <em>packs</em> y consta de ubicar los instaladores en las\ncarpetas respectivas pero hacer el seguimiento de algunas dependencias para\nubicar los requeridos no me parece c\u00f3modo y prefiero sacrificarlos.</p>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/convert-windows-esd-wim.png\"><img alt=\"Men\u00fa de convertir imagen ESD a WIM.\" src=\"../../../../_images/convert-windows-esd-wim.png\" style=\"width: 400px; height: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Men\u00fa de conversi\u00f3n de imagen ESD a WIM con selecci\u00f3n de la versi\u00f3n de Windows deseada.</span><a class=\"headerlink\" href=\"#id7\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/windows-minimal-openshell-scoop.png\"><img alt=\"Windows m\u00ednimo en m\u00e1quina Virtual.\" src=\"../../../../_images/windows-minimal-openshell-scoop.png\" style=\"width: 600px; height: 400px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Windows m\u00ednimo en m\u00e1quina virtual, haciendo uso de <em>Open Shell</em> y aplicaciones de <em>scoop</em>.</span><a class=\"headerlink\" href=\"#id8\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#obtener-imagen-de-windows\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Obtener imagen de Windows<a class=\"headerlink\" href=\"#obtener-imagen-de-windows\" title=\"Link to this heading\">#</a></h3><p>Este es nuestro punto base, as\u00ed que lo explicaremos primero. La forma de\nobtener una imagen de Windows es a trav\u00e9s de la p\u00e1gina oficial <a class=\"reference internal\" href=\"#win10\" id=\"id1\"><span>[win10]</span></a>\n(descarga gratuita pero no licenciada) seleccionando la edici\u00f3n, lenguaje y\narquitectura (si es un equipo reciente, estamos seguros que es 64 bits).</p><p>Una segunda opci\u00f3n, es a trav\u00e9s de Media Creation Tool <a class=\"reference internal\" href=\"#mediacreation\" id=\"id2\"><span>[mediacreation]</span></a>, una\nutilidad de Microsoft para la descarga de la imagen de Windows. En esta\nseleccionanos la misma informaci\u00f3n anterior.</p>", "a[href=\"#generar-imagen-de-windows-minima\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Generar imagen de Windows m\u00ednima<a class=\"headerlink\" href=\"#generar-imagen-de-windows-minima\" title=\"Link to this heading\">#</a></h3><p>Terminado el proceso de eliminar las componentes no deseadas, accedemos a\n<code class=\"code docutils literal notranslate\"><span class=\"pre\">Apply</span></code> y luego a <code class=\"code docutils literal notranslate\"><span class=\"pre\">Apply</span> <span class=\"pre\">&amp;</span> <span class=\"pre\">Save</span> <span class=\"pre\">Changes</span> <span class=\"pre\">to</span> <span class=\"pre\">Source</span> <span class=\"pre\">Images</span></code>.\nTerminada la aplicaci\u00f3n de cambios procedemos a <code class=\"code docutils literal notranslate\"><span class=\"pre\">Target</span></code> y la opci\u00f3n\n<code class=\"code docutils literal notranslate\"><span class=\"pre\">Make</span> <span class=\"pre\">a</span> <span class=\"pre\">DVD</span> <span class=\"pre\">ISO</span> <span class=\"pre\">Image</span></code> (pero tambi\u00e9n puedes aprovechar a crear la USB\npara arranque <code class=\"code docutils literal notranslate\"><span class=\"pre\">Copy</span> <span class=\"pre\">Source</span> <span class=\"pre\">to</span> <span class=\"pre\">USB</span> <span class=\"pre\">Flash</span> <span class=\"pre\">Drive</span></code>). Asignamos el nombre a\nnuestra imagen y procedemos. En el caso de la USB se selecciona la unidad de la\nUSB.</p><p>Con nuestra imagen lista, ahora puedes quemarla o usarla para una m\u00e1quina\nvirtual (carga directamente <em>ISO</em>).</p>", "a[href=\"#crear-version-de-windows-minima-con-msmg-toolkit\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Crear versi\u00f3n de Windows m\u00ednima con MSMG Toolkit<a class=\"headerlink\" href=\"#crear-version-de-windows-minima-con-msmg-toolkit\" title=\"Link to this heading\">#</a></h1><p>Reciente elimin\u00e9 la partici\u00f3n de Windows de mi m\u00e1quina por un problema en el\nqu\u00e9 prob\u00e9 crear la tabla de partici\u00f3n de nuevo, pero me dio pereza instalar en\nese momento Windows porque mi sistema operativo principal es Linux. Adem\u00e1s,\nWindows no funcioba fluidamente en la m\u00e1quina.</p><p>Ahora, consider\u00e9 instalarlo en m\u00e1quina virtual, lo que limita a\u00fan m\u00e1s los\nrecursos para Windows y decid\u00ed explorar como obtener un Windows que fuera\nb\u00e1sicamente el sistema operativo sin tanta cosa preinstalada (muchas\nasociadas a servicios que se ejecutan en segundo plano afectando el\nrendimiento o que nunca uso).</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
